description:
Scientists from the near future have begun work on creating a viable time machine. The project results in the creation of two devices, the Alpha Suit, a prototype jump suit, and the Beta Suit, a more advanced, so-called military grade model with features the Alpha Suit lacks such as combat-related timeshifting abilities and an integrated artificial intelligence to prevent the creation of temporal paradoxes.

A first person shooter with a time manipulation twist.

Xpadder with a profile for the Xbox360 controller is included.

This is patched to version 1.02.

